import React, { useState, useCallback, useRef } from "react";
import "./styles.css";
import { toPng } from "html-to-image";
import pixelmatch from "pixelmatch";

import App from './App.js';
import * as ReactDOMServer from 'react-dom/server';

export default function GetDOM() {
  const ref = useRef();
  const [outputOpacity,setOutputOpacity] = useState(0.5);
  const [targetOpacity,setTargetOpacity] = useState(0.5);
  const [dom,setDom] = useState({html:""});

  const onButtonClick = useCallback(() => {
    setDom({html:ReactDOMServer.renderToString(<App/>)});
    if (ref.current === null) {
      return;
    }
    toPng(ref.current, {cacheBust: true })
      .then((dataUrl) => {
        localStorage.setItem('output',dataUrl)
        localStorage.setItem('target',"data:image/png;base64,")
      })
      .catch((err) => {
        console.log(err);
      });
      
  }, [ref]);
  const compare = ()=>{
    const output = localStorage.getItem('output');
    const targetstring = localStorage.getItem('target')
    const image1 = new Image()
    const image2 = new Image()
    const canvases = [...document.querySelectorAll('canvas')]
    image1.src = output
    image2.src = targetstring
    canvases[0].width = 412
    canvases[0].height = 720
    canvases[0].getContext('2d').drawImage(image1, 0, 0)
    canvases[1].width = 412
    canvases[1].height = 720
    canvases[1].getContext('2d').drawImage(image2, 0, 0)
    const img1Ctx = canvases[0].getContext('2d')
    const img2Ctx = canvases[1].getContext('2d')
    const diffCtx = canvases[2].getContext('2d')
    const {width, height} = canvases[0]
    console.log(width,height)
    canvases[2].width = 412
    canvases[2].height = 720
    const img1 = img1Ctx.getImageData(0, 0, 412, 720)
    const img2 = img2Ctx.getImageData(0, 0, 412, 720)
    const diff = diffCtx.createImageData(412, 720)

    const diffCount = pixelmatch(img1.data, img2.data, diff.data, 412, 720, {threshold: 0.1})
    console.log(diff,"diff")
    diffCtx.putImageData(diff, 0, 0)

    
  };
  function slide(e){
    setOutputOpacity(()=>e.target.value / e.target.max);
    setTargetOpacity(()=>(e.target.max - e.target.value) / e.target.max);
  };

  return (
    <div className="maincontainer">
      <button className="snap" onClick={onButtonClick}>Click me</button>
      <button onClick = {compare}>compare</button>
      <div className="outputpane" ref={ref}>
        {/* DOM nodes you want to convert to PNG */}
        <div id="comp" dangerouslySetInnerHTML={{ __html: dom.html }} /> 
      </div>
      <div className="slidebar"><input type="range" className="slider"  min="0" max="50" onChange={(e)=>slide(e)} ></input></div>
      <div className="final">
        <div  className="pane">
          <h3>slide</h3>
         <canvas className="result" id = "result" style={{opacity:outputOpacity,width:412,height:720}}></canvas>
         <canvas className="required" id = "required" style={{opacity:targetOpacity,width:412,height:720}}></canvas>
        </div>
        <div className="pane2"><h3>PM result</h3><canvas></canvas></div>
      </div>
      </div>
  );
}


